# HFW Gameplay Tweaks & Cheat Menu by Nukem
#
# Mod page: https://www.nexusmods.com/horizonforbiddenwest/mods/50 | Source code: https://github.com/Nukem9/hfw-gameplay-tweaks

#
# *** MAIN SETTINGS ***
#
[General]
EnableDebugMenu = true              # Enable the debug menu. Toggled with the hotkey below ('~' by default).
EnableAssetLogging = false          # Log all asset loads to the debug console.
EnableAssetOverrides = true         # Enable the AssetOverrides section below.
DebugMenuFontScale = 1.0            # Change the global font scale in the debug menu.

[Gameplay]
UnlockMapBoundaries = true          # Cheat: Allow the player to explore outside of map boundaries.
UnlockWorldMapMenu = false          # Cheat: Reveal the entire map/fog of war. WARNING: This marks all areas as completed until disabled.
UnlockMountRestrictions = true      # Cheat: Allow using horses/mounts everywhere.
UnlockEntitlementExtras = false     # Cheat: Unlock all preorder and Playstation Network bonuses.
UnlockPhotomodeRestrictions = true  # Cheat: Allow unrestricted photomode camera controls.
UnlockAIvsAIDamage = false          # Cheat: Allow enemy AIs (NPCs/machines) to kill eachother.
UnlockUltraHardRestrictions = false # Cheat: Allow changing Ultra Hard difficulty settings in menus, including aim assist.
UnlockTrapAndTripwireLimits = false # Cheat: Allow unlimited traps and tripwires to be placed.

EnableFreePerks = false             # Cheat: Enable free perks (unlimited perk points).
EnableFreeCrafting = false          # Cheat: Enable free crafting and free merchants (unlimited resources).
EnableGodMode = false               # Cheat: Enable god mode by default (invincibility).
EnableInfiniteClipAmmo = false      # Cheat: Enable infinite clip ammo by default.
EnableInfiniteOverrideTimer = false # Cheat: Enable infinite machine hack timer.
EnableAutoNeutralFaction = false    # Cheat: Enable automatically setting the player's faction to neutral.

IncreaseInventoryStacks = false     # Cheat: Increase inventory stack limits to 1,000,000 (unlimited capacity).
InventoryStackMultiplier = -1       # Change -1 to a number (e.g. 2, 5, 10) to multiply original stack limits instead of using 1,000,000.

DisableCameraMagnetism = false      # Quality of life: Disables all camera magnetism. This centers Aloy in front of the camera.
DisableFocusMagnetism = false       # Quality of life: Disables focus auto aim magnetism.

ForceCustomUltraHard = false        # Cheat: Force the "Custom" menu difficulty to act as "Ultra Hard" difficulty.
ForceNoShaderLoadingScreen = false  # Debug: Force-disables the "compiling shaders" loading screen hang. Expect graphical flickering.

#
# *** HOTKEYS (KEYBINDS) ***
#
# Each hotkey maps to one of the Windows virtual key codes in hexadecimal format. To disable a keybind, set its value to
# -1. You can find a list of keys here: https://docs.microsoft.com/en-us/windows/win32/inputdev/virtual-key-codes
#
[Hotkeys]
ToggleDebugUI = 0xC0        # '~'  key. Toggles the main menu bar and cursor.
TogglePauseGameLogic = -1   # Unbound.  Toggles pausing game logic.
ToggleFreeCamera = 0x75     # 'F6' key. Toggles the free camera.
ToggleNoclip = 0x74         # 'F5' key. Toggles noclip.
IncreaseTimescale = -1      # Unbound.  Increases the timescale by 0.25x.
DecreaseTimescale = -1      # Unbound.  Decreases the timescale by 0.25x.
ToggleTimescale = -1        # Unbound.  Toggles the timescale override.
SpawnEntity = -1            # Unbound.  Spawns an entity when the Entity Spawner window is open.
QuickSave = -1              # Unbound.  Forces a quick save.
QuickLoad = -1              # Unbound.  Forces a quick load.
ToggleAIProcessing = -1     # Unbound.  Toggles pausing AI processing.
TogglePauseTimeOfDay = -1   # Unbound.  Toggles pausing time of day progression.

